1880 год, Эдинбург, Англия. Профессор геологии Линденбрук обнаруживает в образцах лавы из окрестностей вулкана на севере Исландии остатки организмов, исчезнувших с лица Земли тысячи лет назад.

Вывод &#151; под земной корой могла сохраниться доисторическая жизнь! Линденбрук готовит экспедицию к центру Земли, которая должна стартовать через жерло вулкана, а финансирование берёт на себя профессор Гётеборг.

Вскоре он трагически погибает, но его красавица-жена продолжает дело мужа и присоединяется к ученым&#133;
